import React from "react";
import './styles/App.css'
import { BrowserRouter, Route, Routes } from "react-router-dom";
import About from "./pages/About";
import Posts from "./pages/Posts";


function App() {
  return (
    <BrowserRouter>
      <Routes>

      </Routes>
      <Route path="/about">
        <About />
      </Route>

      <Route path="/posts">
        <Posts />
      </Route>
    </BrowserRouter>
  )      
}

export default App;
